import React from 'react';
import './GoalList.css';

function GoalList(props) {
    return (
        <div className='goal'>
            <h1>Course</h1>
            <ul className='goal-list'>   
           {props.goals.map((goal) => {
   return <li>{goal.text}</li>
})
}     
     </ul>
</div>
    );
}

export default GoalList;
